import './ControlsPage.css';

function ControlsPage() {
  return (
    <div className="projectDiv">
      <div className="horizDiv">
        <div className="vertDiv">
          <div className="projectTitle">Controls</div>
          <div className="projectParagraph">THIS IS MY CONTROLS TAB HI</div>
        </div>
        <div className="imageHolder">
          <img></img>
        </div>
      </div>
    </div>
  );
}

export default ControlsPage;
